392858644}},"S12nStore":{"rawS12ns":{"elements":[{"metadata":{"certificateDescription":"In this specialization you learnt to (1) Design a full-fledged Web client application using Bootstrap and AngularJS, (2) Design a hybrid mobile application using the Ionic framework and Cordova, and (3) Develop server-side support for the web application using Node.js, ExpressJS together with database support using MongoDB.","companyLogos":["https:\u002F\u002Fd396qusza40orc.cloudfront.net\u002Fphoenixassets\u002Fs12n_company_logos\u002FFullStack.HKUST.IBM.png"],"recommendedBackground":[],"level":"INTERMEDIATE","partnerImages":{"35":"https:\u002F\u002Fd2j5ihb19pt1hq.cloudfront.net\u002Fsdp_page\u002Fpartner_banners\u002Fhkust.png"},"learningObjectives":["Design a full-fledged Web client application using a Web and JavaScript framework","Design a hybrid mobile application using the Ionic framework and Cordova","Develop server-side support for the web application using Node.js and database support."],"certificateLogo":"https:\u002F\u002Fd2j5ihb19pt1hq.cloudfront.net\u002Fsdp_page\u002Fs12n_logos\u002FHKUST_Full-Stack-Web-Development_Getty488025987.jpg","cmlAdditionalFaqs":[{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EHow long does it take to complete the Full Stack Web Development Specialization?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E"}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003ETime to completion can vary based on your schedule, but most learners are able to complete the Specialization in 6 months.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E"}}},{"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EEach course in the Specialization is offered on a regular schedule, with sessions starting about once per month. If you don't complete a course on the first try, you can easily transfer to the next session, and your completed work and grades will carry over. The Capstone Project will be offered twice a year.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E"}},"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EHow often is each course in the Specialization offered?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E"}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat background knowledge is necessary?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E"}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003ESome familiarity with programming is recommended, although you do not need to have previous web programming skills.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E"}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EDo I need to take the courses in a specific order?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E"}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWe recommend taking the courses in the order presented, as each subsequent course will build on material from previous courses.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E"}}},{"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003ECoursera courses and certificates don't carry university credit, though some universities may choose to accept Specialization Certificates for credit. Check with your institution to learn more.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E"}},"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWill I earn university credit for completing the Full Stack Web Development Specialization?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E"}}},{"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EYoull have a wide range of skills that are immediately applicable to a career in the web development industry. Specifically, youll be able to design a full-fledged Web client application using a Web and JavaScript framework, design a hybrid mobile application using the Ionic framework and Cordova, and develop server-side support for the web application using Node.js together with database support.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E"}},"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat will I be able to do upon completing the Full Stack Web Development Specialization?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E"}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat software will I need to complete the assignments?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E"}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EYou can use any text editor of your choice to complete the coursework and Capstone Project. Additional software required for the specialization can all be downloaded for free. Instructions on configuring your machine with the appropriate software will be provided.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E"}}}],"additionalFaqs":[{"question":"How long does it take to complete the Full Stack Web Development Specialization?","answer":"Time to completion can vary based on your schedule, but most learners are able to complete the Specialization in 6 months."},{"question":"How often is each course in the Specialization offered?","answer":"Each course in the Specialization is offered on a regular schedule, with sessions starting about once per month. If you don't complete a course on the first try, you can easily transfer tone project is the culmination of your journey through the Full Stack Web Development specialization. The Capstone project is aimed at building a fully functional front-end Application (both Web App designed using Bootstrap+AngularJS, and hybrid mobile app implemented using the Ionic framework) and full server-side implementation using Node.js+Express+MongoDB (possibly using a higher level framework). The project provides you an opportunity to demonstrate the skills that you have acquired from the courses within the specialization. \n\nAs a student in this course, you are being provided the opportunity to access IBM Bluemix platform-as-a-service trial for up to six months at no-charge with no credit card (up to a $1500 value).","id":"DzdXURoCEeWg_RJGAuFGjw","slug":"web-development-project","name":"Full Stack Web Development Specialization Capstone Project","startDate":1460954779820,"courseProgress":"19007063~DzdXURoCEeWg_RJGAuFGjw","v2Details":"DzdXURoCEeWg_RJGAuFGjw","membershipIds":[],"memberships":[]},{"courseType":"v2.ondemand","description":"This course concentrates mainly on Javascript based front-end frameworks, and in particular, AngularJS, the most popular among them. We will review the model view controller (MVC) design-pattern in the context of AngularJS. You will be introduced to various aspects of AngularJS including two-way data binding and angular directives and filters. You will then be introduced to angular controllers and scopes. UI routing and templates will then be reviewed. Finally we will look at angular modules and services. Single page application (SPA) development using Angular will also be explored. You must have either completed the previous course in the specialization on Bootstrap, or have a working knowledge of Bootstrap to be able to navigate this course.\n\nAt the end of this course you will:\n\n- Be familiar with client-side Javascript frameworks and the MVC design pattern\n- Be able to implement single page applications in AngularJ
